import React from 'react';
import './item.css'
const Items=(props)=>{
return(
  <div className="Item">
    <img src={props.image}/>
    <h4>{props.brand}</h4>
    <p>{props.name}</p>
    <div className="item-prices">
      <div className="newp">{props.newp}</div>
      <div className="oldp">{props.oldp}</div>
    </div>
  </div>
);

}
export default Items;
